import React, {Component} from "react";
import {DetailWrapper, Header} from "./style";

class Detail extends Component {
    render() {
        return (
            <DetailWrapper>
                <Header>衡水中学</Header>
            </DetailWrapper>
        )
    }
}

export default Detail
